import React from 'react';
import ReactDOM from 'react-dom';
import { ColorGenerator } from './ColorGenerator';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(
  <>
    <ColorGenerator />
  </>,
  document.getElementById('app-body')
);

serviceWorker.unregister();
